	[-64] = "Эти предметы можно получить в награду из:\nЗадания эмиссара (Легион+)\nПовторяемые сокровища (ТЗ+)\nЗадания командирского стола (Легион+)\nЗаветные сверчки (ТЗ)\nЛокальные задания (Легион+)",
	[-70] = "Путешествия во времени без надобности создают новые ID Источников для предметов, несмотря на то, что они имеют те же имена, облики и отображение в Коллекции.\n\nУбедительная просьба разработчикам Blizzard: Пожалуйста, почистите базу данных ID Источников и сделайте варианты предметов из Путешествий во времени/Кованные титанами с тем же ID Источника, что и оригинал, поскольку названия и облики абсолютно идентичны. Не только сделает вашу базу данных чище, но и позволит Собирателям относиться к новым Путешествиям во времени с воодушевлением, нежели с раздражением.\n\n - Crieve, Очень Огорченный Собиратель, у которого теперь всего лишь 64% выполнение Ульдуара, когда было 99%, потому что ваша команда продублировала ID Источников вместо использования уже имеющихся.",
	[-106] = "Получайте больше опыта и репутации в ходе приключений на Азероте и находите таинственные сокровища на Драконьих островах и в Каз Алгаре!",
	[-341] = "Предметы из данного списка - общие облики для предмета выше. Для Режима Уникальных Обликов, этот список может помочь Вам разобраться, почему определённый предмт отмечен как Получен или нет.",
	[-342] = "Этот предмет имеет Уникальный Облик. Вы должны получить именно этот предмет для открытия Облика.",
	[-343] = "Этот список содержит Недоступные предметы, что Дискорд ATT сообщил как ошибки, которые Blizzard ещё не исправили.\n\nВНИМАНИЕ: Все фильтры игнорируются в данном списке для видимости. Только предметы, удалённые из игры из-за халатности, но не из-за гигантского огнедышащего дракона, перечислены в данном списке.\n\nК разработчикам Blizzard: Пожалуйста, почините предметы и события, перечисленные ниже.",
	[-393] = "Патрулирует территорию примерно по кругу.",
	[-395] = "Трое охотников окружили Мару Стремительную Гриву. Вступите с ними в бой, и рядом с Марой Стремительной Гривой появится Побитый сундук. Как только битва закончится, Мара поблагодарит вас и оставит Побитый сундук.",
	[-396] = "Идет продолжающаяся битва четыре на четыре. Помогите Альянсу, победив Отрекшихся Отряд Смерти.",
	[-397] = "Идет продолжающаяся битва четыре на четыре. Помогите Орде, победив воргенов-сталкеров.",
	[-555] = "Эта награда выдаётся за заполнение прогресса Очков путешествия в течение месяца.",
});
