localize(L.HEADER_DESCRIPTIONS, {
	[-24] = "Contiene recompensas que dan al completar el evento.",
	[-28] = "Estos objetos son obtenidos al completar misiones de emisario o cajas de paragon",
	[-29] = "Contiene cosas que se otorgan como recompensa al finalizar ese evento.",
	[-36] = "Es posible que deba estar activo un día festivo específico para que pueda completar las cosas referenciadas en esta sección.",
	[-43] = "Esta sección contiene misiones y domadores relacionados con los Duelos de Mascotas.",
	[-44] = "Esta sección solo mostrará las profesiones de tu personaje actual fuera del modo Cuenta y Depuración.",
	[-47] = "Contiene cosas que son recompensadas o están disponibles en otro contenido dentro de la sección contenedora.\nSe consolidan aquí en un esfuerzo por reducir la duplicación de muchas fuentes posibles.",
	[-49] = "Contiene cosas que se obtienen como recompensa al completar ese escenario.",
	[-50] = "Secretitos traviesos...",
	[-62] = "Las misiones de mundo son misiones por tiempo limitado disponibles en ubicaciones específicas con recompensas variables.\n\n¡Asegúrate de revisar la ventana de misiones de mundo de ATT (/attwq) con frecuencia para ver qué cosas por tiempo limitado debes recolectar!",
	[-64] = "Estos objetos pueden obtenerse de muchas fuentes y, por lo general, no son difíciles de conseguir.\n\nAunque no todas las fuentes son posibles en todas las zonas, aquí hay una lista de posibles fuentes:\nMisión de emisario (Legión y posteriores)\nPNJ raros (MoP y posteriores)\nCofres del tesoro repetibles (SL)\nMisiones de mesa (Legión y posteriores)\nGrillos de deseos (SL)\nMisiones del mundo (Legión y posteriores)\nObjetos de zona (MoP y posteriores)",
	[-70] = "Las dificultades de Paseo en el tiempo crean innecesariamente nuevos ID de Fuente para objetos a pesar de tener exactamente el mismo nombre, apariencia y visualización en la pestaña Colecciones.\n\nUna petición a los desarrolladores de Blizzard: Por favor, limpien la base de datos de ID de Fuente y hagan que sus variantes de Paseo en el tiempo o Forjadas por los titanes usen el mismo ID de Fuente que su base, asumiendo que las apariencias y los nombres sean exactamente los mismos. Esto no solo hará que su base de datos sea mucho más limpia, sino que también hará que los Completistas se entusiasmen con la introducción de más contenido de Paseo en el tiempo, en lugar de temerla.\n\n - Crieve, el Completista de Cuentas Muy Amargado que tenía un 99% de completitud en Ulduar y ahora solo tiene un 64% porque su equipo duplicó los ID de Fuente en lugar de reutilizar el existente.",
	[-106] = "¡Consigue más experiencia y reputación en tus aventuras por Azeroth y descubre tesoros misteriosos en las Islas Dragón y en Khaz Algar!",
	[-213] = "Esta sección te mostrará cosas que puedes comprar en la Tienda del Juego.",
	[-304] = "Estos artículos requieren el rango Legionario/Capitán-Caballero de Campos de Batalla Clásicos/Clasificados o superior para comprarse.",
	[-341] = "Los elementos de esta lista son apariencias compartidas del elemento anterior. En el modo de apariencia única, esta lista puede ayudarlo a comprender por qué o no un elemento específico se marcaría como coleccionado.",
	[-342] = "Este objeto tiene una apariencia única. Debes obtener este objeto específicamente para ganar la apariencia.",
	[-343] = "Esta lista contiene objetos no obtenibles que ATT Discord ha informado como errores que Blizzard aún no ha solucionado.\n\nNOTA: Todos los filtros se ignoran en esta lista para mayor visibilidad. En esta lista solo están presentes los objetos eliminados del juego debido a negligencia y no a un gigantesco dragón que escupe fuego.\n\nA los desarrolladores de Blizzard: arreglen los objetos y encuentros que se enumeran a continuación.",
	[-393] = "Patrulla el área aproximadamente en un círculo.",
	[-395] = "Tres cazadores han rodeado a Mara Crin Presta. Entra en combate con ellos y aparecerá un cofre maltratado cerca de Mara Crin Presta. Una vez que termine la batalla, Mara te lo agradecerá y te dejará con el Cofre maltrecho.",
	[-396] = "Hay una batalla 4x4 en curso. Ayuda a la Alianza derrotando al Forsaken Deathsquad.",
	[-397] = "Hay una batalla 4x4 en curso. Ayuda a la Horda derrotando a los Worgen Stalkers.",
	[-437] = "Si esta misión tiene una marca de verificación, comprueba debajo qué piedra está activa. Si ninguna está marcada, significa que no se puede interactuar con ninguna de las piedras buhogato hoy y que debes volver mañana.",
	[-438] = "Si esta misión tiene una marca de verificación al lado, significa que la piedra está activa.",
	[-439] = "Si esta misión tiene una marca de verificación al lado, significa que la piedra está activa.",
	[-440] = "Si esta misión tiene una marca de verificación al lado, significa que la piedra está activa.",
	[-441] = "Esta misión indica si has activado la Piedra buhogato de Bosque del Ocaso.",
	[-442] = "Esta misión indica si has activado la Piedra buhogato de Feralas.",
	[-443] = "Esta misión indica si has activado la Piedra buhogato de las Tierras del Interior.",
	[-479] = "Estos objetos fueron obtenidos por personajes creados durante el evento Remix y se transfirieron automáticamente a Retail cuando finalizó el evento.",
	[-549] = "Los siguientes conjuntos de objetos se implementaron como recompensas de mejoras de personaje para los receptores del Pergamino de la Resurrección.\n\nPosteriormente, se añadieron a los vendedores del Monte Hyjal y Vash'jir una vez que se retiró el Servicio del Pergamino de la Resurrección.",
	[-550] = "Este es un evento basado en Campos de batalla que coincide con el inicio de los Juegos Olímpicos de Verano. La única vez que se celebró fue en 2008 para coincidir con los Juegos Olímpicos de Pekín, y aunque parecía haber intención de repetirlo, nunca regresó.",
	[-552] = "Estos fueron recompensados por iniciar sesión al menos una vez por facción mientras la película de Warcraft aún estaba en los cines.",
	[-553] = "Promoción del juego móvil Warcraft Rumble.",
	[-560] = "Los siguientes minijuegos cuestan una Ficha de Juego de la Luna Negra y tienen una misión diaria que otorga vale de premio, así como una serie de logros asociados.",
	[-561] = "Para jugar al juego de baile de la Feria de la Luna Negra, habla con Simon Sezdans frente al Pabellón Sur. Cada intento cuesta una Ficha de Juego de la Luna Negra. Hablar con Simon también determinará la dificultad de tu juego de baile:\n ¡Algo divertido y relajado! (Fácil)\n ¡Me gustaría un pequeño desafío! (Medio)\n ¡Enséñame tus movimientos, no te contengas! (Difícil)\n\nEl Maestro de Baile de la Luna Negra no es un juego de ritmo como la mayoría de los juegos de baile, sino un juego de memoria. Tendrás un bailarín a tu lado en la pista de baile, que iniciará una secuencia de movimientos resaltados con runas frente a él. Las partidas fáciles tendrán una secuencia de 3 runas a la vez, las partidas medias, 4 runas, y las partidas difíciles, 5 runas.\n\nHay tres runas posibles: Baile del Pollo (Amarillo), Giro enérgico (Morado) y Agitar puño (Azul). Una vez que el oponente termine su secuencia, tienes 5 segundos para igualar la secuencia exacta utilizada por el Bailarín. No hay castigo por tomarse el tiempo para completar la secuencia, siempre y cuando lo hagas a tiempo y no te saltes ningún paso. El juego termina después de 5 rondas (si completas todos los pasos correctamente), pero puede terminar antes de tiempo si te saltas demasiados. Si no te saltas ningún paso, obtendrás una puntuación perfecta.",
	[-562] = "Aparecen aproximadamente 60 anillos flotantes por toda la isla, pero la mayoría no están sobre la zona de la Feria y se encuentran en el bosque. Los jugadores comienzan con diez segundos de tiempo de vuelo y volar a través de un anillo refrescará la mejora. Planifica una ruta de tal manera que el siguiente anillo esté siempre a menos de 10 segundos del que se está atravesando, ya que hay muchas maneras de cortar el paso.",
	[-563] = "Para maximizar tu puntuación, espera a que la marca actual desaparezca y luego apunta al objetivo central. En cuanto aparezca una marca verde, presiona 1 inmediatamente y, durante el breve tiempo de lanzamiento, mueve tu arma para apuntar al objetivo izquierdo o derecho si es necesario.",
	[-564] = "Cerca de la entrada, los visitantes reciben un mazo para golpear a unos gnolls disecados que salen de nueve barriles en la zona. Los jugadores tendrán 60 segundos para ganar 30 puntos. Los gnolls son de tres tipos: normales, Hogger y bebés, que otorgan 1 punto, 3 puntos o un derribo, respectivamente.",
	[-565] = "Saludos, aficionados a la lucha. ¡Los villanos más malvados de Azeroth se han unido y han vuelto para vengarse! Venid a Ventormenta, Orgrimmar o Dornogal y enfrentaos a los malvados jefes del pasado de Azeroth.",
	[-592] = "Es el aniversario de World of Warcraft! Desde el equipo de desarrollo de WoW, te damos las gracias por disfrutar del mundo de Azeroth y más allá junto a nosotros.",
	[-687] = "Al transferir un Cronoaventurero a retail, cualquier botín de banda Normal+ en tus |cffFF0000bolsas o banco solamente|R otorgará las apariencias para sus variantes de Remix de dificultad BdB, N, H, y M.",
});
localize(L.HEADER_LORE, {
	[-74] = "Uno de estos dragones aparecerá aleatoriamente en las coordenadas asociadas en todo Azeroth.",
	[-318] = "Los conjuntos de clase del Conjunto de Mazmorra nivel 2, comúnmente conocidos como Tier 0.5, se obtienen al completar una larga cadena de misiones para mejorar el primer conjunto disponible como botín en las mazmorras del final del juego y convertirlo en versiones más poderosas. En el WoW actual, estos conjuntos son codiciados por los coleccionistas, ya que la cadena de misiones se eliminó por completo del juego con Cataclysm. ¡En WoW Classic, deberías completar esta cadena de misiones con todos tus personajes antes de esa fecha!",
	[-389] = "Los siguientes objetos se pueden crear usando una Carga de la Eternidad en una Ficha de Armadura Atemporal para una dosis doble de RNG inútil.",
});
