localize(L.HEADER_DESCRIPTIONS, {
	[-29] = "Contiene cosas que se otorgan como recompensa al completar este evento.",
	[-44] = "Esta sección solo mostrará las profesiones de tu personaje actual fuera del modo Cuenta y Debug.",
	[-49] = "Contiene cosas que se obtienen como recompensa al completar este escenario.",
	[-70] = "Las dificultades de Cronoviajes crean innecesariamente nuevos ID de Fuente para objetos a pesar de tener exactamente el mismo nombre, apariencia y visualización en la pestaña Colecciones.\n\nUna petición a los desarrolladores de Blizzard: Por favor, limpien la base de datos de ID de Fuente y hagan que sus variantes de Cronoviajes o Forjadas por los titanes usen el mismo ID de Fuente que su base, asumiendo que las apariencias y los nombres sean exactamente los mismos. Esto no solo hará que su base de datos sea mucho más limpia, sino que también hará que los Completistas se entusiasmen con la introducción de más contenido de Cronoviajes, en lugar de temerla.\n\n - Crieve, el Completista de Cuentas Muy Amargado que tenía un 99% de completitud en Ulduar y ahora solo tiene un 64% porque su equipo duplicó los ID de Fuente en lugar de reutilizar el existente.",
	[-106] = "Gana experiencia y reputación adicional en tus aventuras por Azeroth, ¡y encuentra misteriosas fortunas en las Islas Dragón y Khaz Algar!",
	[-395] = "Tres cazadores han rodeado a Mara Velocrín. Entra en combate con ellos y aparecerá un cofre maltratado cerca de Mara Velocrín. Una vez que termine la batalla, Mara te lo agradecerá y te dejará con el Cofre maltrecho.",
	[-437] = "Si esta misión tiene un check, revisa debajo qué piedra está activa. Si ninguna está marcada, significa que no se puede interactuar con ninguna de las piedras buhogato hoy y que debes volver mañana.",
	[-438] = "Si esta misión tiene un check al lado, significa que la piedra está activa.",
	[-439] = "Si esta misión tiene un check al lado, significa que la piedra está activa.",
	[-440] = "Si esta misión tiene una check al lado, significa que la piedra está activa.",
	[-441] = "Esta misión muestra si has activado la Piedra buhogato de Bosque del Ocaso.",
	[-442] = "Esta misión muestra si has activado la Piedra buhogato de Feralas.",
	[-443] = "Esta misión muestra si has activado la Piedra buhogato de las Tierras del Interior.",
	[-553] = "Promoción del juego para celulares Warcraft Rumble.",
	[-561] = "Para jugar al juego de baile de la Feria de la Luna Negra, habla con Simon Sezdans frente al Pabellón Sur. Cada intento cuesta una Ficha de Juego de la Luna Negra. Hablar con Simon también determinará la dificultad de tu juego de baile:\n ¡Algo divertido y relajado! (Fácil)\n ¡Me gustaría un pequeño desafío! (Medio)\n ¡Enséñame tus movimientos, no te contengas! (Difícil)\n\nEl Maestro de Baile de la Luna Negra no es un juego de ritmo como la mayoría de los juegos de baile, sino un juego de memoria. Tendrás un bailarín a tu lado en la pista de baile, que iniciará una secuencia de movimientos resaltados con runas frente a él. Las partidas fáciles tendrán una secuencia de 3 runas a la vez, las partidas medias, 4 runas, y las partidas difíciles, 5 runas.\n\nHay tres runas posibles: Danza de la gallina (Amarillo), Vuelta poderosa (Morado) y Agitar puño (Azul). Una vez que el oponente termine su secuencia, tienes 5 segundos para igualar la secuencia exacta utilizada por el Bailarín. No hay castigo por tomarse el tiempo para completar la secuencia, siempre y cuando lo hagas a tiempo y no te saltes ningún paso. El juego termina después de 5 rondas (si completas todos los pasos correctamente), pero puede terminar antes de tiempo si te saltas demasiados. Si no te saltas ningún paso, obtendrás una puntuación perfecta.",
	[-565] = "Saludos, fans de la lucha. ¡Los villanos más malvados volvieron en equipos para buscar venganza! Acércate a Ventormenta, Orgrimmar o Dornogal para pelear contra jefes malignos del pasado de Azeroth.",
	[-592] = "¡Es el aniversario de World of Warcraft! Desde el equipo de desarrollo de WoW, te damos las gracias por disfrutar del mundo de Azeroth y más allá junto a nosotros.",
});
