	[-441] = "该任务用于提示你是否已激活暮色森林的猫头鹰石。",
	[-442] = "该任务用于提示你是否已激活菲拉斯的猫头鹰石。",
	[-443] = "该任务用于提示你是否已激活辛特兰的猫头鹰石。",
	[-479] = "这些物品是由在幻境新生活动期间创建的角色获得的，并在活动结束时自动转移到正式服。",
	[-549] = "以下物品套装作为复活卷轴接受者的角色提升奖励而实施。\n\n在复活卷轴服务退役后，它们后来被添加到海加尔山和瓦丝琪尔的商人处。",
	[-550] = "这是一个以战场为基础的活动，与夏季奥运会的开始同时进行。唯一一次庆祝是在2008年，以配合北京奥运会，虽然似乎有意图重复这个活动，但它从未回归。",
	[-552] = "这些是在《魔兽》电影仍在上映期间，每个阵营至少登入一次所获得的奖励。",
	[-553] = "魔兽大作战手游的促销活动。",
	[-555] = "此奖励在当月填满旅行点进度条后获得。",
	[-560] = "以下小游戏每次游玩需要消耗一枚暗月游戏代币，并且每天都有一个任务可以获得奖券以及一些相关的成就。",
	[-561] = "要玩暗月马戏团跳舞游戏，请与南部亭子前的西蒙·塞兹丹斯交谈。每次尝试暗月马戏团跳舞游戏都需要一枚暗月游戏代币。与西蒙交谈还将为您的舞蹈游戏设置难度：\n  只是一些有趣和轻松的东西！（简单）\n  我想要一些挑战！（中等）\n  展示你的动作，不要退缩！（困难）\n\n暗月舞蹈大师不是像大多数舞蹈游戏那样的节奏游戏，而是记忆游戏。你将在舞蹈竞技场旁边有一个舞者，他将开始一系列由他面前的符文突出显示的动作。简单的游戏每次有3个符文的序列，中等游戏4个符文，困难游戏5个符文。\n\n有三种可能的符文：鸡舞（黄色）、强力旋转（紫色）和拳头泵（蓝色）。一旦对手完成他们的序列，你有5秒钟的时间来匹配舞者使用的确切序列。只要你及时完成并且没有错过任何步骤，就不会因为花时间完成序列而受到惩罚。\n\n如果您成功完成所有步骤，游戏将在5轮后结束，但如果您错过太多步骤，游戏可能会提前结束。没有错过任何步骤将为您带来完美的分数。",
	[-562] = "整个岛上大约会出现60个漂浮的环，但大多数不在马戏团区域内，而是在树林中。玩家开始时有十秒的飞行时间，飞过一个环会刷新这个增益效果。规划一条路线，使下一个环始终在即将飞过的环的10秒内，因为有很多方法可以被切断。",
	[-563] = "为了最大化你的得分，等待当前的标记消失，然后瞄准中间的目标。只要出现任何绿色标记，立即按1，在短暂的施法时间内，如果有必要，将你的枪移动到指向左侧或右侧目标的位置。",
	[-564] = "位于入口附近，游客们会收到一个大锤，用来敲打从该区域的九个桶中弹出的填充豺狼人。玩家将有60秒的时间来获得30分。豺狼人有三种类型：普通的、霍格和婴儿，分别奖励1分、3分或一次击倒。",
	[-565] = "战斗迷们，大家好。世界上最邪恶的反派们联手归来，誓要复仇！前往暴风城、奥格瑞玛或多诺加尔，与艾泽拉斯过去的邪恶首领们一决高下。",
	[-592] = "这是一个每年重现的活动，发生在十一月初到年底之间。",
	[-652] = "赞达拉部族对潘达利亚大陆的入侵始于雷神岛的开放。战争使者遍布整个大陆，拥有难度各异的单人挑战机制及可获取的坐骑！与好友一同刷取这些奖励吧。",
});
